USE master;
GO
--Check if Database already exists
IF EXISTS (SELECT name FROM master.sys.databases WHERE name = 'VividSeatsChallenge')
    DROP DATABASE VividSeatsChallenge;

--Creating Database
CREATE DATABASE VividSeatsChallenge;
GO
USE VividSeatsChallenge
GO

/****************************************
Tables creation
****************************************/

CREATE TABLE dbo.UserReferals (
	UserReferalID INT IDENTITY PRIMARY KEY,
	UserReferal VARCHAR(255) UNIQUE NOT NULL,
	LastUpdate  DATETIME2 NOT NULL DEFAULT SYSDATETIME()
);

CREATE TABLE dbo.Customers (
	CustomerID		BIGINT IDENTITY PRIMARY KEY,
	FullName		VARCHAR(100) NOT NULL,
	DateOfBirth		DATE,
	Username		VARCHAR(100) UNIQUE NOT NULL,
	PasswordHash	BINARY(100) NOT NULL,
	Email			VARCHAR(100) UNIQUE NOT NULL,
	UserReferalID   INT NOT NULL,
	LastUpdate		DATETIME2 NOT NULL DEFAULT SYSDATETIME(),

	CONSTRAINT Customers_Check_EmailFormat CHECK(Email LIKE '%___@___%.__%'),
	CONSTRAINT FK_CustomersUserReferals FOREIGN KEY (UserReferalID) REFERENCES dbo.UserReferals(UserReferalID)
);

CREATE TABLE dbo.EventTypeCatalog (
	EventTypeID		INT IDENTITY PRIMARY KEY,
	EventType   	VARCHAR(255) UNIQUE NOT NULL,
	LastUpdate		DATETIME2 NOT NULL DEFAULT SYSDATETIME()
);

CREATE TABLE dbo.Events (
	EventID			 BIGINT IDENTITY(100,1) PRIMARY KEY,
	EventName		 VARCHAR(255) NOT NULL,
	EventDate		 DATETIME NOT NULL,
	EventTypeID		 INT NOT NULL,
	EventDescription VARCHAR(255),
	LastUpdate		 DATETIME2 NOT NULL DEFAULT SYSDATETIME(),

	CONSTRAINT UQ_Events_EventName_EventDate UNIQUE(EventName, EventDate),
	CONSTRAINT FK_Events_EventTypeCatalog FOREIGN KEY (EventTypeID) REFERENCES dbo.EventTypeCatalog(EventTypeID)
);

CREATE TABLE dbo.Tickets (
	TicketID	BIGINT IDENTITY PRIMARY KEY,
	EventId		BIGINT NOT NULL,
	Section		VARCHAR(255) NOT NULL,
	Row			VARCHAR(255) NOT NULL,
	Quantity	INT NOT NULL,
	UnitPrice   DECIMAL(19,2) NOT NULL,
	LastUpdate	DATETIME2 NOT NULL DEFAULT SYSDATETIME(),

    CONSTRAINT FK_Tickets_Events FOREIGN KEY (EventID) REFERENCES dbo.Events(EventID)
);

CREATE TABLE dbo.OrderStatusCatalog (
	StatusID	INT IDENTITY PRIMARY KEY,
	StatusName  VARCHAR(100) UNIQUE NOT NULL,
    StatusDesc  VARCHAR(255) NULL,
	LastUpdate	DATETIME2 NOT NULL DEFAULT SYSDATETIME()
);

CREATE TABLE dbo.Orders (
	OrderID			BIGINT IDENTITY PRIMARY KEY,
	CustomerID		BIGINT NOT NULL,
	TicketID		BIGINT NOT NULL,
	StatusID		INT NOT NULL,
	OrderDate		DATETIME NOT NULL,
	LastUpdate		DATETIME2 NOT NULL DEFAULT SYSDATETIME(),

	CONSTRAINT FK_Orders_OrderStatusCatalog FOREIGN KEY (StatusID) REFERENCES dbo.OrderStatusCatalog(StatusID),
	CONSTRAINT FK_Orders_Customers FOREIGN KEY (CustomerID) REFERENCES dbo.Customers(CustomerID),
	CONSTRAINT FK_Orders_Tickets FOREIGN KEY (TicketID) REFERENCES dbo.Tickets(TicketID)
);

CREATE TABLE dbo.CountryCatalog (
  CountryCode VARCHAR(3) PRIMARY KEY,
  CountryName VARCHAR(255) UNIQUE NOT NULL,
  LastUpdate DATETIME2 NOT NULL DEFAULT SYSDATETIME()
);

CREATE TABLE dbo.Locations (
	LocationID	 BIGINT IDENTITY PRIMARY KEY,
	EventID		 BIGINT NOT NULL,
	LocationName VARCHAR(255) NOT NULL,
	City		 VARCHAR(255) NOT NULL,
	State		 VARCHAR(255) NULL,
	CountryCode  VARCHAR(3) NOT NULL,
	LastUpdate   DATETIME2 NOT NULL DEFAULT SYSDATETIME(),

	CONSTRAINT FK_Locations_Events FOREIGN KEY (EventID) REFERENCES dbo.Events(EventID),
    CONSTRAINT FK_Locations_CountryCatalog FOREIGN KEY (CountryCode) REFERENCES dbo.CountryCatalog(CountryCode),
    CONSTRAINT UQ_Events_EventID_LocationName UNIQUE(EventID, LocationName)
);

CREATE TABLE dbo.Addresses (
	AddressID	 INT IDENTITY PRIMARY KEY,
	CustomerID	 BIGINT NOT NULL,
	PrimaryFlag  BIT NOT NULL,
	AddressLine1 VARCHAR(255) NOT NULL,
	AddressLine2 VARCHAR(255),
	City		 VARCHAR(255) NOT NULL,
	State		 VARCHAR(255) NOT NULL,
	PostalCode	 VARCHAR(15) NOT NULL,
	CountryCode  VARCHAR(3) NOT NULL,
	PhoneNumber	 VARCHAR(255),
	LastUpdate	 DATETIME2 NOT NULL DEFAULT SYSDATETIME(),

    CONSTRAINT FK_Addresses_CountryCatalog FOREIGN KEY (CountryCode) REFERENCES dbo.CountryCatalog(CountryCode)

);
GO

